INSERT INTO step(recipe_id, step_order, details) VALUES (1, 8, 'Serve the skewers with a side of rice or salad.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 9, 'In a large pot, heat the olive oil over medium heat.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 10, 'Use an immersion blender to puree the soup to your desired consistency.');
INSERT INTO step(recipe_id, step_order, details) VALUES (1, 11, 'Season the meat with salt, pepper, and your favorite spices.');
